import React from "react";
import * as ReactDOMClient from "react-dom/client";

// ReactDOM.render(
//   React.createElement("input", {
//     placeholder: "help me",
//     onClick: () => console.log("clicked");
//     onMouseEnter: () => console.log("over mouse")
//   }), document.getElementById("app")
// );

const inputClick = console.log("clicked");
const mouseOver = console.log("over mouse");

const helpText = "help me";

const elements = (
  <div className="name">
    <h1>{helpText}</h1>
    <input
      placeholder={helpText}
      onClick={inputClick}
      onMouseEnter={mouseOver}
    />
    <p>{helpText === "help me" ? "ok" : "no"}</p>

    <p>bcobec0</p>
    <h1>cekkogoecg</h1>
    <ul>
      <li color="yellow">1</li>
      <li>2</li>
      <li>3</li>
      <li>4</li>
      <li>5</li>
      <li>6</li>
    </ul>
  </div>
);

const elementsTwo = (
  <div className="name">
    <p>bcobec0</p>
    <h1>cekkogoecg</h1>
  </div>
);

const app = ReactDOMClient.createRoot(document.getElementById("app"));

app.render(elements);
